//HeaderMenuTests.js-----------------------------------------

//import React from "react";
import { useSelector, useDispatch } from "react-redux";

export function HeaderMenuTests() {

  let dispatch = useDispatch();
  let visible_tests = useSelector(state => state.visible_tests);
  let visible_words = useSelector(state => state.visible_words);
  let visible_listen = useSelector(state => state.visible_listen);
  let visible_phrases = useSelector(state => state.visible_phrases);
  let visible_jokes = useSelector(state => state.visible_jokes);

  let value_tests = useSelector(state => state.value_tests);
  let value_words = useSelector(state => state.value_words);
  let value_listen = useSelector(state => state.value_listen);
  let value_phrases = useSelector(state => state.value_phrases);
  let value_jokes = useSelector(state => state.value_jokes);

console.log('HeaderMenuTests: visible_tests=',visible_tests);  
console.log('HeaderMenuTests: visible_words=',visible_words);

  function changeVisibilityTests(e) {
    console.log(('HeaderMenuTests: changeVisibilityTests---'));
    if(!(typeof document.getElementById('list_words_wrapper') === 'underfined') || (document.getElementById('list_words_wrapper') === null))
      document.getElementById('list_words_wrapper').style.visibility = visible_words;
    if(!(typeof document.getElementById('list_tests_wrapper') === 'underfined') || (document.getElementById('list_tests_wrapper') === null))
      document.getElementById('list_tests_wrapper').style.visibility = visible_tests;
    if(!(typeof document.getElementById('list_listen_wrapper') === 'underfined') || (document.getElementById('list_listen_wrapper') === null))
      document.getElementById('list_listen_wrapper').style.visibility = visible_listen;
    if(!(typeof document.getElementById('list_phrases_wrapper') === 'underfined') || (document.getElementById('list_phrases_wrapper') === null))
      document.getElementById('list_phrases_wrapper').style.visibility = visible_phrases;

//    document.getElementById('list_jokes_wrapper').style.visibility = visible_jokes;

    if(!(typeof document.getElementById('tests_wrapper') === 'underfined') || (document.getElementById('tests_wrapper') === null))
      document.getElementById('tests_wrapper').style.visibility = value_tests;
    if(!(typeof document.getElementById('words_wrapper') === 'underfined') || (document.getElementById('words_wrapper') === null))
      document.getElementById('words_wrapper').style.visibility = value_words;
    if(!(typeof document.getElementById('listen_wrapper') === 'underfined') || (document.getElementById('listen_wrapper') === null))
      document.getElementById('listen_wrapper').style.visibility = value_listen;
    if(!(typeof document.getElementById('phrases_wrapper') === 'underfined') || (document.getElementById('phrases_wrapper') === null))
      document.getElementById('phrases_wrapper').style.visibility = value_phrases;
    if(!(typeof document.getElementById('jokes_wrapper') === 'underfined') || (document.getElementById('jokes_wrapper') === null))
      document.getElementById('jokes_wrapper').style.visibility = value_jokes;

//    e.target.style.background = 'red';
    return dispatch({type: 'SHOW_TESTS_MENU', action: 'visible'});
  }//end of changeVisibilityTests --------

  return (<div id="header_menu_tests" className="header_menu_item" onMouseEnter={changeVisibilityTests}>Tests</div>)

}//end of HeaderMenuTests --------
